import React from 'react';

const ReceiptPage = ({ transactionId, onBack }) => {
  return (
    <div>
      <h2 className="text-2xl font-bold mb-4">Recibo</h2>
      <p>ID da transação: {transactionId}</p>
      <button onClick={onBack} className="mt-4 px-4 py-2 bg-primary-600 text-white rounded">
        Voltar
      </button>
    </div>
  );
};

export default ReceiptPage;
